SET IMPLICIT_TRANSACTIONS OFF;
SET NOCOUNT ON;
MERGE [Branches] USING (
VALUES (@p0, @p1, @p2, @p3, @p4, @p5, @p6, @p7, @p8, @p9, @p10, @p11, @p12, @p13, @p14, @p15, @p16, @p17, @p18, 0),
(@p19, @p20, @p21, @p22, @p23, @p24, @p25, @p26, @p27, @p28, @p29, @p30, @p31, @p32, @p33, @p34, @p35, @p36, @p37, 1)) AS i ([AcceptingOrders], [AddressAr], [AddressEn], [ClosingTime], [CreatedAt], [DefaultPreparationTimeMinutes], [DeliveryFee], [DeliveryRadiusKm], [FreeDeliveryThreshold], [IsActive], [Latitude], [Longitude], [MinOrderAmount], [NameAr], [NameEn], [OpeningTime], [Phone], [RestaurantId], [UpdatedAt], _Position) ON 1=0
WHEN NOT MATCHED THEN
INSERT ([AcceptingOrders], [AddressAr], [AddressEn], [ClosingTime], [CreatedAt], [DefaultPreparationTimeMinutes], [DeliveryFee], [DeliveryRadiusKm], [FreeDeliveryThreshold], [IsActive], [Latitude], [Longitude], [MinOrderAmount], [NameAr], [NameEn], [OpeningTime], [Phone], [RestaurantId], [UpdatedAt])
VALUES (i.[AcceptingOrders], i.[AddressAr], i.[AddressEn], i.[ClosingTime], i.[CreatedAt], i.[DefaultPreparationTimeMinutes], i.[DeliveryFee], i.[DeliveryRadiusKm], i.[FreeDeliveryThreshold], i.[IsActive], i.[Latitude], i.[Longitude], i.[MinOrderAmount], i.[NameAr], i.[NameEn], i.[OpeningTime], i.[Phone], i.[RestaurantId], i.[UpdatedAt])
OUTPUT INSERTED.[Id], i._Position;
